import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import HomePage from './HomePage';
import Login from './login';
import AdminDashboard from './admindashboard';
import Dashboard from './Dashboard';
import ProtectedRoute from './ProtectedRoute';
import { AuthProvider } from './AuthContext';

// Page Imports
import ClockInOutGPS from './pages/ClockInOutGPS';
import AttendanceLogs from './pages/AttendanceLogs';
import TravelLogs from './pages/TravelLogs';
import ManageUsers from './pages/ManageUsers';
import ForgotPassword from './pages/ForgotPassword';
import ResetPassword from './pages/ResetPassword';
import SubmitLeavePage from './pages/SubmitLeavePage';
import SubmitTripPage from './pages/SubmitTripPage';
import LeaveHistoryPage from './pages/LeaveHistoryPage';
import SuspiciousActivityPage from './pages/SuspiciousActivityPage';
import TeamAttendancePage from './pages/TeamAttendancePage';
import LeaveRequests from './pages/LeaveRequests';


const App = () => {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<HomePage />} />
          <Route path="/login" element={<Login />} />
          <Route path="/forgot-password" element={<ForgotPassword />} />
          <Route path="/reset-password/:token" element={<ResetPassword />} />

          {/* Employee Routes */}
          <Route path="/dashboard" element={<ProtectedRoute><Dashboard /></ProtectedRoute>} />
          <Route path="/clock-in-out-gps" element={<ProtectedRoute><ClockInOutGPS /></ProtectedRoute>} />
          <Route path="/submit-trip" element={<ProtectedRoute><SubmitTripPage /></ProtectedRoute>} />
          <Route path="/submit-leave" element={<ProtectedRoute><SubmitLeavePage /></ProtectedRoute>} />
          <Route path="/attendance-logs" element={<ProtectedRoute><AttendanceLogs /></ProtectedRoute>} />
          <Route path="/travel-logs" element={<ProtectedRoute><TravelLogs /></ProtectedRoute>} />
          <Route path="/leave-history" element={<ProtectedRoute><LeaveHistoryPage /></ProtectedRoute>} />

          {/* Admin & Manager Routes */}
          <Route path="/admindashboard" element={<ProtectedRoute allowedRoles={['admin', 'manager']}><AdminDashboard /></ProtectedRoute>} />
          <Route path="/leave-requests" element={<ProtectedRoute allowedRoles={['admin', 'manager']}><LeaveRequests /></ProtectedRoute>} />
          <Route path="/suspicious-activity" element={<ProtectedRoute allowedRoles={['admin', 'manager']}><SuspiciousActivityPage /></ProtectedRoute>} />
          <Route path="/team-attendance" element={<ProtectedRoute allowedRoles={['admin', 'manager']}><TeamAttendancePage /></ProtectedRoute>} />

          {/* Admin Only Route */}
          <Route path="/manage-users" element={<ProtectedRoute allowedRoles={['admin']}><ManageUsers /></ProtectedRoute>} />
        </Routes>
      </Router>
    </AuthProvider>
  );
};

export default App;
